import React from "react";
import classes from "./DailyHighlights.module.css";

const DailyHighlightsList = (props) => {
  const { name, image, price } = props.item;
  return (
    <div className={classes.cover}>
      <div className={classes.scrollImages}>
        <div className={classes.child}>
          <img src={image} alt="" className={classes.childIamge} />
          <h2 className={classes.childName}>{name}</h2>
          <p className={classes.childPrice}>{price}</p>
        </div>
      </div>
    </div>
  );
};

export default DailyHighlightsList;
